import React from 'react';
import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
    <header id="header">
        <div className="inner">
            <Link to="/" className="logo">
            <img src={`${CTVLogoCleanCopy.png}`} style={{width: 'auto', height: 50, display: 'block', marginLeft: 'auto', marginRight: 'auto'}} alt="Home" />
            </Link>
            <nav id="nav">
            <Link to="/">Home</Link>
            <Link to="https://www.worldometers.info/coronavirus/country/india" target="_blank">Covid Stats</Link>
            <Link to="/AboutUs">About Us</Link>
            <Link to="/login_reg">Log In/Register</Link>
            </nav>
            <Link to="#navPanel" className="navPanelToggle"><span className="fa fa-bars" /></Link>
        </div>
    </header>
      
    );
};

export default Navbar;
